import React from 'react';
import './styles.css';

const Footer = () => (
  <footer className="footer">
    <div className="footer-container">
      <div className="footer-left">esquerda</div>

      <div className="footer-right">direita</div>
    </div>
  </footer>
);

export default Footer;
